import React from 'react';
import MainContainer from './Components/MainContainer'
import Navigation from './Components/Navigation'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"


function App() {

  return (
    <>
      <Router>
        <MainContainer>
          <Navigation/>
        </MainContainer>
      </Router>
    </>
  );
}

export default App;
